import{e as p}from"./app.dbf5d933.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const d={},c=p('<p>\u8FD9\u662F\u5468\u672B\u7684\u65F6\u5019\u82B1\u4E86\u4E24\u4E2A\u5C0F\u65F6\u5199\u7684\u4E00\u7BC7\u6587\u7AE0\uFF0C\u57FA\u672C\u4E0A\u4E5F\u662F\u601D\u7D22\u826F\u4E45\uFF0C\u7136\u540E\u4E00\u65F6\u5174\u8D77\uFF0C\u4E00\u6C14\u5475\u6210\u5C31\u8DC3\u7136\u7EB8\u4E0A\u4E86\u3002\u6709\u65F6\u5019\u53EF\u80FD\u6C34\u5E73\u8FD8\u4E0D\u591F\uFF0C\u5199\u4E0D\u51FA\u90A3\u4E48\u591A\u529B\u900F\u7EB8\u80CC\u7684\u6587\u5B57\uFF0C\u4F46\u662F\u4E00\u7247\u8D64\u8BDA\u800C\u53C8\u7EC6\u817B\u7684\u5FC3\uFF0C\u5BF9\u672C\u8D28\u91CC\u7684\u63A2\u5BFB\uFF0C\u662F\u6C38\u4E0D\u6B62\u6B65\u7684\uFF01\uFF01\uFF01</p><p>\u8FDB\u5165\u6B63\u9898\u3002</p><p>\u6280\u672F\u7A76\u7ADF\u662F\u4E2A\u4EC0\u4E48\u4E1C\u897F\uFF0C\u4F60\u53C8\u662F\u5426\u66FE\u5728\u6280\u672F\u5F53\u4E2D\u8FF7\u5931\u81EA\u5DF1\uFF1F</p><p>\u8FD9\u662F\u8FD9\u51E0\u5929\u6765\u4E00\u76F4\u5728\u8111\u6D77\u601D\u7D22\u7684\u4E00\u4E2A\u5C0F\u95EE\u9898\u3002</p><h2 id="_1-\u53F3\u503E\u6781\u5316" tabindex="-1"><a class="header-anchor" href="#_1-\u53F3\u503E\u6781\u5316" aria-hidden="true">#</a> 1\uFF0C\u201C\u53F3\u503E\u6781\u5316\u201D</h2><p>\u6280\u672F\uFF0C\u53EF\u4EE5\u4F5C\u4E3A\u7A0D\u5FAE\u7A33\u5B9A\u7684\u751F\u6D3B\u652F\u6491\u4FDD\u969C\uFF0C\u5373\u4FBF\u53EF\u80FD\u4F60\u4E0D\u90A3\u4E48\u4E0A\u8FDB\uFF0C\u5E73\u5E38\u4E0D\u90A3\u4E48\u7684\u4FDD\u6301\u5F88\u9AD8\u7684\u5B66\u4E60\u6FC0\u60C5\uFF0C\u57FA\u672C\u4E0A\u4E5F\u80FD\u52A9\u4F60\u7EF4\u6301\u4E00\u4E2A\u76F8\u5BF9\u4E0D\u9519\u7684\u7A33\u5B9A\u3002\u4F46\u662F\u4EBA\u5728\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0C\u4E0D\u514D\u7684\u5728\u8FC7\u5EA6\u5B89\u9038\u4E4B\u4E2D\u653E\u7EB5\uFF0C\u4ECE\u800C\u96BE\u4E8E\u56DE\u5F52\u52E4\u594B\uFF0C\u751A\u81F3\u53EF\u80FD\u4F1A\u906D\u9047\u6DD8\u6C70\u3002\u8FD9\u662F\u6700\u53EF\u60B2\u4E5F\u6700\u6050\u6016\u7684\u4E8B\u60C5\u3002</p><p><img src="http://t.eryajf.net/imgs/2021/09/a0a89a244cb7fe38.jpg" alt="image"></p><p>\u8FD8\u672A\u4ECE\u4E8B\u6280\u672F\u8FD9\u4E2A\u5DE5\u4F5C\u4E4B\u524D\u5C31\u7ECF\u5E38\u542C\u522B\u4EBA\u8BF4\uFF0C\u201C\u6280\u672F\u884C\u4E1A\u5C31\u662F\u4E00\u4E2A\u4E0D\u65AD\u5B66\u4E60\uFF0C\u751A\u81F3\u7EC8\u751F\u5B66\u4E60\u7684\u5DE5\u4F5C\u201D\uFF0C\u201C\u6709\u7684\u4EBA\u4F1A\u4E00\u76F4\u4E0D\u65AD\u5B66\u4E60\u4E3A\u81EA\u5DF1\u5145\u7535\uFF0C\u6709\u7684\u4EBA\u5440\uFF0C\u4F60\u770B\u4ED6\u4E09\u5341\u51E0\uFF0C\u56DB\u5341\u51E0\u4E86\uFF0C\u6280\u672F\u80FD\u529B\u957F\u8FDB\u4E0D\u5927\uFF0C\u7136\u540E\u5C31\u57FA\u672C\u4E0A\u4E00\u76F4\u90FD\u662F\u90A3\u4E48\u4E00\u4E2A\u8001\u6837\u5B50\u4E86\u201D\uFF0C\u7C7B\u4F3C\u8FD9\u6837\u7684\u8BF4\u6CD5\u592A\u591A\u592A\u591A\u4E86\uFF0C\u4F46\u6211\u60F3\uFF0C\u6211\u4EEC\u4E0D\u53EF\u80FD\u505A\u5230\u7EC8\u751F\u4E00\u76F4\u5B66\u4E60\uFF0C\u4E5F\u4E0D\u53EF\u80FD\u505A\u5230\u7EC8\u751F\u4E00\u8DEF\u9AD8\u5347\uFF0C\u4F46\u662F\u81F3\u5C11\u5E94\u8BE5\u505A\u5230\u7ACB\u5FD7\u52E4\u594B\uFF0C\u4E0D\u65AD\u63D0\u5347\u81EA\u5DF1\u624D\u662F\u3002\u6240\u6709\u7684\u9053\u7406\uFF0C\u4E0D\u7528\u591A\u8BF4\uFF0C\u56E0\u4E3A\u4F5C\u4E3A\u6210\u5E74\u4EBA\u7684\u6211\u4EEC\uFF0C\u6CA1\u6709\u8C01\u662F\u4E0D\u6E05\u695A\u7684\uFF0C<code>\u4F46\u662F\u5982\u679C\u4F60\u4E5F\u77E5\u9053\u8FD9\u4E48\u591A\u7684\u9053\u7406\uFF0C\u5374\u4E0D\u613F\u610F\u8DF5\u884C\u4E00\u4E9B\u9053\u7406\uFF0C</code>\u90A3\u4E48\u5982\u679C\u6700\u540E\u88AB\u6DD8\u6C70\u4E86\uFF0C\u8BF7\u4E00\u5B9A\u4E0D\u8981\u54ED\u51FA\u58F0\u3002</p><p>\u6211\u7684\u4E00\u4E2A\u670B\u53CB\u4E4B\u524D\u505A\u7684\u662F\u8FD0\u7EF4\u76D1\u63A7\u5C97\u4F4D\uFF0C\u65E5\u5E38\u5DE5\u4F5C\u5C31\u662F\u76EF\u7740\u5DF2\u7ECF\u5B8C\u5584\u4E86\u7684\u76D1\u63A7\u8BBE\u65BD\uFF0C\u5982\u679C\u6709\u62A5\u8B66\u5C31\u8BB0\u5F55\u4E00\u4E0B\uFF0C\u6216\u8005\u901A\u77E5\u76F8\u5173\u4EBA\u5458\u8FDB\u884C\u5904\u7406\u3002\u53EF\u4EE5\u8BF4\u8FD9\u662F\u4E00\u4EFD\u76F8\u5BF9\u8F7B\u677E\u7684\u5DE5\u4F5C\uFF0C\u5E73\u5E38\u6211\u4E5F\u62C5\u5FC3\u4ED6\u5728\u8FD9\u6837\u7684\u5DE5\u4F5C\u73AF\u5883\u5F53\u4E2D\u4F1A\u628A\u81EA\u5DF1\u8FF7\u5931\u6389\uFF0C\u4F46\u662F\u76F8\u8DDD\u6BD4\u8F83\u8FDC\uFF08\u4ED6\u5728\u5317\u4EAC\uFF0C\u800C\u6211\u5728\u676D\u5DDE\uFF09\uFF0C\u65E5\u5E38\u6C9F\u901A\u4EE5\u53CA\u4EA4\u6D41\u4E5F\u5C31\u5C11\u4E86\uFF0C\u518D\u52A0\u4E4B\u73B0\u5728\u65F6\u5149\u5982\u98DE\uFF0C\u4E00\u4E0D\u7559\u795E\u4E4B\u4E2D\uFF0C\u4EC5\u4EC5\u534A\u5E74\u4E4B\u540E\uFF0C\u4ED6\u5C31\u544A\u77E5\u6211\u8BF4\uFF0C\u516C\u53F8\u628A\u76D1\u63A7\u8FD9\u4E2A\u90E8\u95E8\u62C6\u6389\u4E86\uFF0C\u8981\u6362\u65B0\u5DE5\u4F5C\u4E86\uFF0C\u6211\u8BF4\u90A3\u627E\u5457\uFF0C\u4ED6\u8BF4\u4E4B\u524D\u8FD9\u6BB5\u65F6\u95F4\u73A9\u75AF\u4E86\uFF0C\u5565\u4E5F\u6CA1\u5B66\u8FDB\u53BB\uFF0C\u4E4B\u524D\u638C\u63E1\u7684\u53C8\u90FD\u5FD8\u5F97\u5DEE\u4E0D\u591A\u4E86\uFF0C\u987F\u65F6\u6709\u4E00\u4E9B\u5C0F\u8FF7\u832B\u4E86\u3002\u5509\uFF0C\u8001\u5144\uFF0C\u65E9\u77E5\u4F1A\u6709\u4ECA\u65E5\u7684\u8FF7\u832B\uFF0C\u4F55\u82E6\u6765\u5F53\u521D\u4E0D\u594B\u53D1\u800C\u56FE\u5F3A\u5462\u3002\u53E4\u8BED\u6709\u4E91\uFF1A\u201C\u5B66\u5982\u9006\u6C34\u884C\u821F\uFF0C\u4E0D\u8FDB\u5219\u9000\u201D\uFF0C\u65E2\u7136\u6CA1\u6709\u957F\u8FDB\uFF0C\u90A3\u4E00\u5B9A\u5C31\u662F\u9000\u6B65\u4E86\u3002\u5728\u9057\u61BE\u4E2D\u540E\u6094\u81EA\u5DF1\u6CA1\u6709\u65E9\u70B9\u52AA\u529B\uFF0C\u4E0D\u5982\u5C31\u5728\u6B64\u523B\u6C89\u4E0B\u5FC3\u6765\uFF0C\u628A\u4E00\u4E2A\u4E2A\u5C0F\u6280\u672F\u70B9\u770B\u5230\u5FC3\u91CC\u53BB\uFF0C\u7136\u540E\u53D8\u6210\u81EA\u5DF1\u7684\u3002</p><p>\u6240\u4EE5\u6280\u672F\u5C31\u662F\u8FD9\u4E48\u7684\u795E\u5947\uFF0C\u4F60\u7684\u4ED8\u51FA\u4E0E\u4F60\u7684\u4EA7\u51FA\u6216\u8005\u8BF4\u56DE\u62A5\u4E00\u5B9A\u4E00\u5B9A\u5C06\u662F\u5448\u6B63\u6BD4\u7684\uFF0C\u5F53\u4F60\u638C\u63E1\u7740\u786C\u5B9E\u5B9E\u7684\u6280\u672F\u7684\u65F6\u5019\uFF0C\u9762\u5BF9\u5DE5\u4F5C\u4E2D\u7684\u96BE\u9898\uFF0C\u8E0F\u5B9E\u800C\u53C8\u81EA\u4FE1\u7684\u8FDB\u884C\u5206\u6790\u89E3\u51B3\uFF0C\u90A3\u79CD\u81EA\u5982\u7684\u611F\u89C9\uFF0C\u6050\u6015\u4EBA\u6D3B\u7740\u518D\u6CA1\u6709\u6BD4\u8FD9\u66F4\u7F8E\u597D\u7684\u4E8B\u60C5\u4E86\u5427\u3002\u76F8\u53CD\uFF0C\u628A\u81EA\u5DF1\u7684\u201C\u5DE5\u4F5C\u751F\u6D3B\u201D\u8FC7\u7684\u50CF\u6C34\u7BA1\u4E00\u6837\u7A7A\u6D1E\uFF0C\u5374\u53C8\u62FF\u7740\u4E00\u4E9B\u85AA\u8D44\uFF0C\u8FD9\u5BF9\u4E8E\u516C\u53F8\u6765\u8BF4\uFF0C\u4E5F\u662F\u76F8\u5F53\u4E0D\u8D1F\u8D23\u4EFB\u7684\u3002\u56E0\u6B64\u806A\u660E\u5982\u6211\u4EEC\u7684\uFF0C\u5F53\u6211\u4EEC\u77E5\u9053\u8FD9\u4E9B\u9053\u7406\uFF0C\u4E1A\u5DF2\u660E\u786E\u77E5\u9053\u5411\u5DE6\u8D70\u5411\u53F3\u8D70\u4E4B\u540E\u7684\u7ED3\u679C\u6216\u8005\u5176\u4E2D\u7684\u6ECB\u5473\uFF0C\u90A3\u4E48\u4E3A\u4EC0\u4E48\u4E0D\u5C31\u5728\u6B64\u523B\u51FA\u53D1\uFF0C\u8BA9\u81EA\u5DF1\u53D8\u5F97\u5145\u5B9E\uFF0C\u9971\u6EE1\uFF0C\u4E30\u5BCC\u8D77\u6765\u5462\uFF01 <code>\u4EFB\u4F55\u65F6\u5019\u51FA\u53D1\uFF0C\u53EA\u8981\u771F\u6B63\u6E90\u81EA\u672C\u5FC3\uFF0C\u90FD\u4E0D\u7B97\u665A</code>\u3002</p><p>\u5728\u8FD9\u4E00\u5C42\u9762\u4E0A\uFF0C\u6211\u81EA\u5DF1\u7ED9\u81EA\u5DF1\u6253\u4E2A\u516B\u5341\u5206\u5427\uFF0C\u65E5\u5E38\u4E2D\u4E5F\u7B97\u80FD\u591F\u505A\u5230\u4E00\u4E9B\u81EA\u5F8B\u53BB\u5B66\u4E60\uFF0C\u4F46\u662F\u8FD8\u8FDC\u8FDC\u4E0D\u591F\uFF0C\u56E0\u4E3A\u8FD8\u4E0D\u591F\u4F18\u79C0\uFF0C\u4E5F\u56E0\u4E3A\u4E0D\u591F\u52AA\u529B\u3002</p><h2 id="_2-\u5DE6\u503E\u6781\u5316" tabindex="-1"><a class="header-anchor" href="#_2-\u5DE6\u503E\u6781\u5316" aria-hidden="true">#</a> 2\uFF0C\u201C\u5DE6\u503E\u6781\u5316\u201D</h2><p>\u8BF4\u5B8C\u4E86\u201C<code>\u90A3\u4E00\u5934</code>\u201D\uFF0C\u518D\u6765\u8C08\u8C08\u6211\u5728\u201C<code>\u8FD9\u4E00\u5934</code>\u201D\u7684\u4E00\u4E9B\u7422\u78E8\u4E0E\u54C1\u9274\u3002</p><p>\u8FD9\u5934\u7684\u98CE\u666F\u672A\u5FC5\u662F\u6BCF\u4E2A\u4EBA\u90FD\u4F53\u4F1A\u8FC7\u7684 \uFF0C\u800C\u4E14\u5F53\u4F60\u5728\u6B23\u8D4F\u9605\u5386\u8FD9\u5934\u7684\u98CE\u666F\u7684\u65F6\u5019\uFF0C\u5E38\u5E38\u4F1A\u8BA9\u81EA\u5DF1\u53D8\u5F97\u4E0D\u50CF\u6765\u65F6\u90A3\u4E48\u8C26\u606D\uFF08\u8FD9\u662F\u4E00\u53E5\u5BCC\u6709\u6DF1\u610F\u7684\u8BDD\uFF0C\u4E0B\u8FB9\u6211\u4F1A\u8BE6\u7EC6\u6765\u89E3\u6790\u8FD9\u53E5\u8BDD\uFF09\u3002</p><p>\u6211\u4EEC\u6CA1\u6709\u770B\u89C1\u8FC7\u4E00\u4E2A\u6B4C\u624B\u5728\u521B\u4F5C\u51FA\u5F88\u591A\u5F88\u591A\u7ECF\u5178\u6B4C\u66F2\u4F46\u8FD8\u4E0D\u51FA\u540D\u7684\u65F6\u5019\u7684\u6837\u5B50\uFF0C\u6211\u60F3\uFF0C\u90A3\u4E00\u5B9A\u662F\u975E\u5E38\u52E4\u594B\u5E76\u5BCC\u88D5\u52E4\u6073\u7684\u6837\u5B50\u5427\uFF0C\u6216\u8005\u8BF4\uFF0C\u90A3\u4E2A\u65F6\u5019\u7684\u52E4\u594B\u5F53\u4E2D\u7684\u76EE\u7684\u6240\u5305\u542B\u7684\u540D\u5229\u6210\u5206\u5927\u6982\u53EA\u6709\u767E\u5206\u4E4B\u4E00\u7684\u5427\uFF0C\u66F4\u591A\u7684\u5E94\u8BE5\u662F\u5BF9\u81EA\u5DF1\u6DF1\u5185\u5FC3\u7684\u5174\u8DA3\u7684\u6EE1\u8DB3\uFF0C\uFF0C\u4F46\u6211\u4EEC\u770B\u89C1\u8FC7\u4E00\u4E2A\u6B4C\u624B\u5728\u7ECF\u5178\u6B4C\u66F2\u6D41\u4F20\uFF0C\u6210\u540D\u4E86\u4E4B\u540E\uFF0C\u53D8\u5F97\u518D\u4E5F\u4E0D\u4F1A\u6709\u5F53\u521D\u521B\u4F5C\u7684\u90A3\u79CD\u6837\u5B50\uFF0C\u751A\u81F3\u53D8\u5F97\u5927\u724C\uFF0C\u75AF\u72C2\u8D77\u6765\uFF0C\u8FD9\u5927\u6982\u4E5F\u662F\u6B4C\u624B\u81EA\u5DF1\u6240\u6CA1\u6709\u6599\u60F3\u8FC7\u7684\u7F62\u3002</p><p>\u6211\u4EEC\u6CA1\u6709\u89C1\u8FC7\u5218\u9707\u4E91\u5728\u594B\u7B14\u75BE\u4E66\uFF0C\u82E6\u5FC3\u5B64\u8BE3\u521B\u4F5C\u65E9\u5E74\u4E00\u4E9B\u7ECF\u5178\u7684\u65F6\u5019\u7684\u52E4\u6073\u4EE5\u53CA\u6587\u6C14\uFF0C\u4F46\u6211\u4EEC\u770B\u89C1\u8FC7\u4ED6\u201C\u89E6\u7535\u201D\uFF08\u63A5\u89E6\u7535\u5F71\u7535\u89C6\u505A\u7F16\u5267\uFF09\u4E4B\u540E\uFF0C\u90A3\u79CD\u4E16\u4FD7\u5F53\u4E2D\u7684\u5404\u79CD\u540D\u95FB\u5229\u517B\u6240\u7ED9\u4ED6\u5E26\u53BB\u7684\u51B2\u51FB\u3002\uFF08\u8FD9\u4E00\u6BB5\u6839\u636E\u5D14\u6C38\u5143\u4F5C\u7684\u300A\u5218\u9707\u4E91\u7684\u5BB6\u8BAD\u300B\u4E00\u6587\u6240\u77E5\uFF09\u3002</p><p>\u663E\u800C\u6613\u89C1\uFF0C\u6B4C\u624B\u5F53\u5E74\u90A3\u79CD\u7EAF\u7CB9\u7684\u521B\u4F5C\u662F\u53EF\u8D35\u7684\uFF0C\u5218\u9707\u4E91\u5F53\u5E74\u90A3\u5145\u6EE1\u4EBA\u6587\u5173\u6000\u4EE5\u53CA\u60B2\u5929\u60AF\u4EBA\u7684\u6587\u4EBA\u6C14\u8D28\u662F\u53EF\u8D35\u7684\uFF0C\uFF0C\u53EA\u53EF\u60DC\uFF0C\u5728\u4ECA\u5929\uFF0C\u8FD9\u4E9B\u53EF\u8D35\u90FD\u4E22\u4E86\uFF0C\u4E5F\u5F88\u96BE\u627E\u56DE\u3002\u8FD9\uFF0C\u5C31\u662F\u6211\u5F00\u5934\u90A3\u53E5\u5BCC\u6709\u6DF1\u610F\u7684\u8BDD\u7684\u73B0\u5B9E\u6848\u4F8B\u3002</p><p>\u90A3\u4E48\u5728\u6280\u672F\u8FD9\u4E2A\u884C\u4E1A\uFF0C\u770B\u4E0A\u53BB\u597D\u50CF\u4E0D\u5927\u4F1A\u51FA\u73B0\u8FD9\u79CD\u60C5\u51B5\uFF0C\u6BD5\u7ADF\u6280\u672F\u80FD\u5E26\u7ED9\u4F60\u7684\u4E1C\u897F\u5E76\u4E0D\u4F1A\u50CF\u6210\u540D\u53D1\u5927\u8D22\u90A3\u4E48\u591A\u90A3\u4E48\u5927\u3002\u4F46\u4E8B\u5B9E\u4E0A\u5E76\u975E\u5982\u6B64\uFF0C\u56E0\u4E3A<code>\u5728\u4EBA\u5FC3\u8FD9\u4E00\u4E2A\u5C42\u9762\uFF0C\u4F60\u7684\u81EA\u5F8B\u80FD\u529B\uFF0C\u4F60\u7684\u81EA\u7701\u80FD\u529B\uFF0C\u4F60\u7684\u6539\u8FC7\u80FD\u529B\u8D8A\u5DEE\uFF0C\u90A3\u4E48\u4F60\u5C06\u4F1A\u968F\u4E4B\u6E38\u8D70\u7684\u53EF\u80FD\u6027\uFF0C\u4E5F\u5C31\u8D8A\u5927\u3002</code></p><p>\u4E5F\u8BB8\u4F60\u66FE\u52AA\u529B\u5982\u65AF\uFF0C\u5728\u8BB8\u591A\u4E2A\u65E0\u4EBA\u77E5\u6653\u7684\u6DF1\u591C\uFF0C\u8BA4\u771F\u94BB\u7814\u67D0\u4E2A\u6280\u672F\u70B9\uFF0C\u7EDE\u5C3D\u8111\u6C41\u8BA9\u81EA\u5DF1\u5728\u67D0\u4E9B\u73B0\u6709\u6280\u672F\u80FD\u529B\u4E2D\u7A81\u7834\uFF0C\u4E8E\u662F\uFF0C\u4F60\u56E0\u6B64\u7A81\u98DE\u731B\u8FDB\uFF0C\u4F60\u56E0\u6B64\u5C0F\u6709\u6210\u5C31\uFF0C\u4F60\u56E0\u6B64\u53EF\u4E3A\u4EBA\u5E08\uFF0C\u4F60\u56E0\u6B64\u6388\u4EBA\u4EE5\u6E14\uFF0C\u4F60\u56E0\u6B64\u5F00\u5FC3\u5FEB\u4E50\uFF0C\u4F60\u56E0\u6B64\u8DBE\u9AD8\u6C14\u6602\uFF0C\u4F60\u56E0\u6B64\u5F97\u610F\u5FD8\u5F62\uFF0C\u4F60\u56E0\u6B64\u80CC\u79BB\u66FE\u7ECF\u3002</p><p>\u8BF4\u56DE\u5230\u6211\u81EA\u5DF1\u3002\u4ECE 3 \u6708\u4EFD\u8BA4\u771F\u6574\u7406\u535A\u5BA2\uFF0C\u672C\u7740\u5F00\u6E90\u7CBE\u795E\u628A\u597D\u4E1C\u897F\u65E0\u507F\u5206\u4EAB\u51FA\u6765\uFF0C\u5728\u7FA4\u91CC\u70ED\u5FC3\u5BF9\u4E00\u4E9B\u5728\u67D0\u4E2A\u6280\u672F\u70B9\u521A\u5165\u95E8\u7684\u670B\u53CB\u8FDB\u884C\u6307\u5BFC\uFF0C\u751A\u81F3\u51E0\u4E4E\u624B\u628A\u624B\u5BF9\u4E00\u4E9B\u964C\u751F\u4EBA\u8FDB\u884C\u5E2E\u52A9\uFF0C\uFF0C\u6211\u51E0\u4E4E\u611F\u89C9\u81EA\u5DF1\u592A\u5389\u5BB3\u4E86\uFF0C\u5404\u79CD\u5404\u6837\u7684\u6210\u5C31\u611F\u6CB9\u7136\u800C\u751F\u3002\u800C\u5982\u679C\u4E0D\u662F\u56E0\u4E3A\u81EA\u5DF1\u4E0D\u4F1A\u67D0\u4E2A\u4E1C\u897F\uFF0C\u5728\u8BF7\u6559\u522B\u4EBA\u65F6\u522B\u4EBA\u5BF9\u81EA\u5DF1\u7684\u6001\u5EA6\u6240\u5F15\u8D77\u7684\u601D\u8003\uFF0C\u90A3\u4E48\u51E0\u4E4E\u5728\u611F\u89C9\u81EA\u5DF1\u5389\u5BB3\u7684\u65F6\u5019\u4E5F\u5C06\u6E38\u8D70\u5230\u5DE6\u503E\u6781\u5316\u7684\u5730\u6B65\u4E86\u3002</p><p>\u4E8B\u60C5\u662F\u8FD9\u6837\u7684\uFF0C\u65E0\u610F\u4E4B\u95F4\u78B0\u5230\u4E00\u4E2A\u7F51\u53CB\u5206\u4EAB\u5F88\u591A\u4ED6\u4E2A\u4EBA\u6574\u7406\u7684\u597D\u4E1C\u897F\uFF0C\u771F\u7684\u662F\u597D\u4E1C\u897F\uFF0C\u91CC\u8FB9\u5E72\u8D27\u4E0D\u6B62\u4E00\u70B9\u70B9\uFF0C\u4E5F\u8DB3\u4EE5\u770B\u51FA\u4ED6\u5728\u8FD9\u4E9B\u5E72\u8D27\u7684\u6574\u7406\u4E4B\u4E2D\u6240\u4ED8\u51FA\u7684\u6C57\u6C34\u4E0E\u52E4\u594B\uFF0C\u4E8E\u662F\u63A5\u7740\u6709\u5E78\u8BA4\u8BC6\u8FD9\u4F4D\u6574\u7406\u8005\uFF0C\u8868\u8FBE\u4E00\u756A\u5D07\u656C\u4E4B\u60C5\uFF0C\u63A5\u7740\u4ED6\u51FA\u4E86\u4E00\u4E24\u9898\uFF0C\u8BF4\u8003\u8003\u6211\u7684 command \u6C34\u5E73\uFF0C\u540E\u6765\u6211\u786E\u5B9E\u88AB\u90A3\u4E24\u9898\u7ED9\u96BE\u4F4F\u4E86\uFF0C\u4FBF\u60F3\u5230\u8BF7\u6559\u4ED6\uFF0C\u8BF7\u6559\u65F6\uFF0C\u4ED6\u8FD9\u91CC\u57FA\u672C\u4E0A\u90A3\u79CD\u5C0F\u767D\u8BF7\u6559\u5927\u795E\u7684\u9519\u4F4D\u611F\u5DF2\u7ECF\u751F\u6210\uFF0C\u4ECE\u800C\uFF0C\u4E00\u4E9B\u8BA9\u6211\u542C\u8D77\u6765\u611F\u89C9\u5E76\u4E0D\u5927\u5408\u9002\u7684\u8BDD\uFF0C\u8BF8\u5982\u6211\u7528\u547D\u4EE4\u90FD\u5B9E\u73B0\u4E86\uFF0C\u4F60\u5374\u7528\u811A\u672C\uFF0C\u4F30\u8BA1\u4F60\u5199\u597D\u8FD9\u4E2A\u811A\u672C\uFF0C\u6211\u8FD9\u547D\u4EE4\u90FD\u6267\u884C\u51E0\u5341\u904D\u4E86\u3002\u7C7B\u4F3C\u8FD9\u822C\u90A3\u6837\u7684\u8BDD\uFF0C\u4E0D\u7EDD\u4E8E\u8033\u98DE\u5954\u800C\u6765\u3002\u540E\u6765\u6211\u8D76\u5FD9\u53C8\u7FFB\u5230\u81EA\u5DF1\u7ED9\u522B\u4EBA\u6307\u5BFC\u7684\u65F6\u5019\u8BF4\u8FC7\u7684\u4E00\u4E9B\u8BDD\uFF0C\u201C\u4F60\u628A\u4F60\u7684\u547D\u4EE4\u7ED9\u6211\u770B\u4E00\u4E0B\u201D\uFF0C\u6216\u8005\u5176\u4ED6\u7C7B\u4F3C\u7684\u8BDD\u3002<code>\u8FD9\u4E0D\u4EC5\u8BA9\u6211\u9677\u5165\u6C89\u601D\uFF0C\u81EA\u5DF1\u6709\u591A\u5C11\u7684\u8D44\u683C\uFF0C\u53EF\u4EE5\u8FD9\u822C\u90A3\u6837\u3002</code></p><p>\u66FE\u7ECF\u5927\u6982\u4E5F\u4E0D\u6B62\u4E00\u6B21\uFF0C\u5728\u542C\u5230\u522B\u4EBA\u5BF9\u81EA\u5DF1\u8BF4\uFF0C\u54C7\uFF0C\u5927\u795E\u8036\uFF0C\u597D\u5389\u5BB3\u554A\uFF0C\u819C\u62DC\u819C\u62DC\u3002\u81EA\u5DF1\u90FD\u56DE\u5E94\uFF0C\u4E0D\u8981\u8FD9\u6837\u8BF4\u5566\uFF0C<code>\u95FB\u9053\u6709\u5148\u540E</code>\u800C\u5DF2\uFF0C\u53EA\u4E0D\u8FC7\u6211\u6BD4\u4F60\u65E9\u4E00\u70B9\u4E86\u89E3\u8FD9\u4E2A\u6280\u672F\uFF0C\u5E76\u6295\u5165\u4E86\u4E00\u4E9B\u7CBE\u529B\uFF0C\u5176\u5B9E\u4F60\u4ED8\u51FA\u7CBE\u529B\u4E4B\u540E\uFF0C\u4E5F\u662F\u53EF\u4EE5\u5F88\u719F\u7EC3\u638C\u63E1\u8FD9\u4E9B\u4E1C\u897F\u7684\u54E6\u3002<code>\u4F46\u56DE\u5E94\u5F52\u56DE\u5E94\uFF0C\u8FD9\u4E9B\u5634\u4E0A\u8BF4\u7684\uFF0C\u5927\u591A\u65F6\u5019\u90FD\u5E76\u6CA1\u6709\u4E0E\u884C\u4E3A\u4E00\u81F4\u3002</code></p><p>\u60ED\u6127\u4E4B\u81F3\u3002\u4E00\u60F3\u5230\u8FD9\u4E9B\uFF0C\u6211\u5C31\u53EA\u60F3\u6697\u6697\u6124\u6068\u81EA\u5DF1\uFF0C\u660E\u660E\u4EC0\u4E48\u90FD\u4E0D\u4F1A\uFF0C\u8FD8\u4E00\u526F\u4EC0\u4E48\u90FD\u4F1A\u7684\u6837\u5B50\uFF0C\u5BF9\u522B\u4EBA\u6307\u4E1C\u9053\u897F\u3002\u6216\u8005\u53EF\u80FD\u4F1A\u4E86\u4E00\u4E9B\u4E1C\u897F\uFF0C\u5728\u4E0E\u4EBA\u4EA4\u6D41\u8FC7\u7A0B\u4E2D\uFF0C\u5C31\u53D8\u5F97\u98D8\u98D8\u7136\uFF0C\u4E0D\u77E5\u4F60\u662F\u8001\u4E09\uFF0C\u6211\u662F\u8001\u51E0\u3002\u8FD9\u4E9B\u90FD\u662F\u975E\u5E38\u503C\u5F97\u6CE8\u610F\u7684\uFF0C\u5982\u679C\u4E0D\u80FD\u5728\u53CA\u65F6\u7684\u65F6\u95F4\u53CA\u65F6\u6CE8\u610F\uFF0C\u90A3\u4E48\u6700\u540E\u5403\u4E8F\u7684\uFF0C\u4E5F\u4E00\u5B9A\u8FD8\u662F\u81EA\u5DF1\u3002</p><p><img src="http://t.eryajf.net/imgs/2021/09/65ed4de787e0bd13.jpg" alt="image"></p><p>\u770B\u5230\u8FD9\u91CC\uFF0C\u53EF\u80FD\u5DF2\u7ECF\u6709\u4EBA\u4E0D\u81EA\u89C9\u7684\u60F3\u8BF4\u51FA\u201C\u4E0D\u5FD8\u521D\u5FC3\uFF0C\u65B9\u5F97\u59CB\u7EC8\u201D\u51E0\u4E2A\u5B57\u4E86\uFF0C\u4E0D\u9519\uFF0C\u7B2C\u4E8C\u70B9\u57FA\u672C\u4E0A\u5C31\u662F\u8868\u8FBE\u7684\u8FD9\u4E00\u5C42\u610F\u601D\uFF0C\u4F46\u662F\u6211\u5374\u504F\u504F\u6545\u610F\u901A\u7BC7\u907F\u8BA9\u8FD9\u51E0\u4E2A\u5B57\uFF0C\u539F\u56E0\u4E5F\u975E\u5E38\u7B80\u5355\uFF0C\u90A3\u5C31\u662F<code>\u6709\u65F6\u5019\u6211\u4EEC\u8D8A\u719F\u77E5\u7684\u8FD9\u4E9B\u9053\u7406\uFF0C\u5C31\u8D8A\u5BB9\u6613\u88AB\u6211\u4EEC\u629B\u8BF8\u8111\u540E\u3002</code></p><p><code>\u521D\u5FC3\u73CD\u8D35\uFF0C\u8BF7\u52FF\u76F8\u5FD8\u3002\u5E0C\u671B\u6240\u6709\u4EBA\uFF0C\u5728\u4EFB\u4F55\u65F6\u523B\uFF0C\u4E0D\u8BBA\u7ECF\u5386\u4E86\u4EC0\u4E48\uFF0C\u4E0D\u8BBA\u9047\u5230\u4E86\u54EA\u4E9B\uFF0C\u90FD\u80FD\u591F\u5E38\u601D\u8FD9\u51E0\u4E2A\u5B57\uFF0C\u5E76\u7EC8\u751F\u8DF5\u884C\u4E4B\u3002</code></p><h2 id="_3-\u5C0F\u7ED3\u3002" tabindex="-1"><a class="header-anchor" href="#_3-\u5C0F\u7ED3\u3002" aria-hidden="true">#</a> 3\uFF0C\u5C0F\u7ED3\u3002</h2><p>\u4EE5\u4E0A\u662F\u4E0B\u5348\u95F2\u6765\u601D\u7D22\u7684\u4E24\u70B9\uFF0C\u770B\u4F3C\u662F\u4E24\u79CD\u72B6\u6001\u7684\u4E00\u4E2A\u6781\u7AEF\uFF0C\u4F46\u662F\u6211\u4EEC\u65E5\u5E38\u4E2D\u5374\u7ECF\u5E38\u4F1A\u5728\u8FD9\u4E24\u70B9\u4E2D\u4E2D\u62DB\u3002</p><blockquote><p>\u5982\u679C\u73B0\u5728\u80FD\u5403\u9971\u996D\u4E86\uFF0C\u5C31\u8BA9\u6211\u4EEC\u5FD8\u8BB0\u4E86\u9EA6\u5B50\u662F\u600E\u4E48\u5F97\u51FA\u6765\u7684\uFF0C\u90A3\u4E48\u5403\u9971\u996D\u4E86\u53C8\u610F\u4E49\u6709\u591A\u5927\u5462\u3002 \u5982\u679C\u73B0\u5728\u7CBE\u901A\u4E86\u9EA6\u5B50\u662F\u600E\u4E48\u5F97\u6765\u7684\uFF0C\u5C31\u8BA9\u6211\u4EEC\u53EF\u4EE5\u53BB\u63F6\u63C4\u90A3\u4E9B\u4E0D\u77E5\u9053\u7684\u4EBA\uFF0C\u90A3\u4E48\u8FD9\u79CD\u7CBE\u901A\u53C8\u610F\u4E49\u6709\u591A\u5927\u5462\u3002</p></blockquote><p>\u56DE\u60F3\u4E00\u4E0B\u81EA\u5DF1\uFF0C\u597D\u50CF\u7ECF\u5E38\u5728\u80FD\u591F\u8F7B\u677E\u4E00\u5206\u7684\u65F6\u5019\uFF0C\u5F80\u5F80\u90FD\u60F3\u8F7B\u677E\u4E94\u5206\uFF0C\u6700\u540E\u597D\u50CF\u90FD\u8F7B\u677E\u4E86\u5341\u5206\u3002\u53C8\u597D\u50CF\u5728\u5C0F\u6709\u6210\u5C31\u7684\u65F6\u5019\uFF0C\u5C31\u98D8\u7136\u8D77\u6765\u4E86\u5462\u3002</p><p>\u6280\u672F\u53EF\u80FD\u662F\u4E00\u4E2A\u4E2D\u6027\u7684\u8BCD\u6C47\uFF0C\u4F46\u662F\u5BF9\u4E8E\u4EBA\u6027\u800C\u8A00\uFF0C\u8FD9\u662F\u4E00\u4E2A\u5584\u4E4B\u5219\u4E3A\u5584\uFF0C\u6076\u4E4B\u5219\u4E3A\u6076\u7684\u4E1C\u897F\uFF0C\u5982\u679C\u6211\u4EEC\u4E0D\u7559\u795E\uFF0C\u5C31\u5F88\u5BB9\u6613\u88AB\u81EA\u5DF1\u7684\u4EBA\u6027\u7ED9\u8003\u9A8C\u4E86\u3002\u800C\u5F53\u6211\u4EEC\u638C\u63E1\u4E86\u8FD9\u4E9B\u4EBA\u6027\u8003\u9A8C\u7684\u672C\u8D28\u4E4B\u540E\uFF0C\u5C31\u80FD\u591F\u4E8E\u672A\u96E8\u800C\u7EF8\u7F2A\uFF0C\u9632\u6076\u60A3\u4E8E\u672A\u7136\u3002</p><p>\u8FD9\u4E5F\u662F\u6211\u5199\u51FA\u6B64\u6587\u7684\u76EE\u7684\uFF0C\u8C28\u6B64\u4E8E\u4F17\u4EBA\u5171\u52C9\uFF01\uFF01\uFF01</p>',32);function a(o,r){return c}var h=e(d,[["render",a]]);expo